import React, {
  Component
} from 'react'
import TextBox from '../../components/TextBox/TextBox'
import { properties, fSize, fWeight } from '../../conf/properties'
import Header from '../../components/Header/Header'
import HeaderDown from '../../components/Header/HeaderDown'
import favicon from '../../assets/images/favicon.png'
import guser from '../../assets/images/guser.png'
import Footer from '../../components/Footer/Footer'
import FooterDown from '../../components/Footer/FooterDown'
import styled from 'styled-components'


const div = styled.div`
height: 100%;
margin: 0;
`

const MainWrapper = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  height: 400px;
  width: 100%;
`
const SubWrapper1 = styled.div`
  width: 40%;
  background-color : ${properties.white};
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 24px;
  @media (max-width: 700px) {
  width: 65%;
}
`
const SubCol1 = styled.div`
  width: 70px;
  height: 70px;
  background-image: url(${props => props.favicon});
  background-size: cover;

`
const SubCol2 = styled.div`
  width: 300px;
  height: 60%;
  display: flex;
  flex-direction: column;
  margin: 24px 0px;
  border: 1px solid rgba(0, 40, 100, 0.12);
`
const InsideCol = styled.div`
  width: 100%;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  margin-top: 15px;
  /* border: 1px solid rgba(0, 40, 100, 0.12); */
`

const InsideRow = styled.div`
  width: 60%;
  height: 145px;
  border: 1px solid rgba(0, 40, 100, 0.12);
  margin-left: 0px 20px;

`
const InsideImage = styled.div`
  width: 100%;
  height: 90%;
  background-image: url(${props => props.guser});
  background-size: cover;
  background-repeat: no-repeat;
`
const InsideText = styled.div`
  width: 100%;
  height: auto;
  text-align: center;
  margin: 0px 0px;
`

class Register extends Component {
  render() {
    return (<div>
      <Header />
      <HeaderDown />

      <MainWrapper >
        <SubWrapper1 >
          <SubCol1 favicon={favicon} />
          <SubCol2>
            <InsideCol color={properties.littleLightGrey}
              fontSize={fSize.slarge}>


                Sign up

            </InsideCol>
            <InsideCol>
              <InsideRow >
                <InsideImage guser={guser} />
                <InsideText>
                  <TextBox
                    color={properties.littleLightGrey}
                    fontSize={fSize.slarge}>
                    Guest User
                  </TextBox>
                </InsideText>
              </InsideRow>
              <InsideRow>

              </InsideRow>
            </InsideCol>
          </SubCol2>
        </SubWrapper1>
      </MainWrapper>

      <Footer />
      <FooterDown />
    </div >
    )
  }
}

export default Register
